Rising up early, oiling hair, showering, wearing new clothes, getting ready, lighting lamps, bursting crackers, laughter and joy with the entire family who came for diwali, watching movies, cousins gossip, eating all the sweets and muruku, visiting neighbours, sharing the happiness and sweets with anyone who comes home. What more could be the festive vibe? 💫
This shoot is super special to me since all of us from the same industry came together 😍🥲 🧿 Isn't it something to be appreciated? 🌟
